import { createContext, useContext } from 'react'
import { Outlet } from 'react-router-dom'

const theme = {
    primary: 'yellow',
    secondary: 'cyan',
}

const ThemeContext = createContext()

const Theme = () => (
    <ThemeContext.Provider value={theme}>
        <Outlet />
    </ThemeContext.Provider>
)

export default Theme
